import React from 'react';
import { NavLink } from 'react-router-dom';
import './DropDown.css';
import Dropdown from 'react-bootstrap/Dropdown';

class dropDown extends React.Component {

  state = {
    drop: false
  }

  dropClickHandler = () => {
    this.setState(prev => {
      return { drop: !prev.drop };
    })
  }

  componentDidMount() {
    console.log(this.props.links);
  }
  render() {
    // return <select onChange={this.props.click} className="navDrop" value='Browse'>
    //   {
    //     this.props.links.map(item=>{
    //       return <option  key={item.name} value={item.value}>{item.name}<NavLink to={item.value}></NavLink></option>
    //     })
    //     }
    // </select>

    return <React.Fragment>
      <NavLink className='tag' to='/yay'><li className='browseShow' onClick={this.dropClickHandler} id='tag'>Browse</li></NavLink>
      <ul className={this.state.drop ? 'navDrop navDropDown' : 'navDrop'}>
        {this.props.links.map(item => {
          return <li className={this.state.drop ? 'drop' : 'dontDrop'} key={item.value}>{item.name}</li>
        })}
      </ul>
    </React.Fragment>

  }
}

export default dropDown;
